import React from "react"


export const Sidebardata = [
    {
        title:"Home",
        icon: <i class="bi bi-house-door-fill" style={{ fontSize: 24 }}> </i> ,
        link: "/"
    },
    {
        title:"Works",
        icon: <i class="bi bi-briefcase-fill" style={{ fontSize: 24 }}> </i>,
        link: "/works"
    },
    {
        title:"Quotation",
        icon:<i class="bi bi-send-fill" style={{ fontSize: 24 }}> </i>,
        link: "/quotation"
    },
    {
        title:"Payment",
        icon:<i class="bi bi-wallet2" style={{ fontSize: 24 }}> </i>,
        link: "/payment"
    },
    {
        title:"Receipts",
        icon:<i class="bi bi-receipt" style={{ fontSize: 24 }}> </i>,
        link: "/receipts"
    }

]
